INSERT INTO `node_type` VALUES ('article','Article','node','An <em>article</em> is suitable for news items and press releases. By default, an <em>article</em> entry is automatically featured on the site front page, and provides the ability to post comments.','<p>Write your article below. A teaser will automatically be built from the first few lines.<br />\r\nYou can attach images and other files.</p>',1,'Title',1,'Body',0,1,1,0,'story');
INSERT INTO `node_type` VALUES ('event','Event','node','An <em>event</em> is suitable for any content that is strongly associated with a date, such as a meeting or a conference. Events are displayed in a calendar accessible from the main menu.','<p>Provide the event details below. Include a start date and an optional end date.<br />\r\nYou can also attach images and other files.</p>',1,'Title',1,'Body',0,1,1,0,'');
INSERT INTO `node_type` VALUES ('image','Image','image','An image (with thumbnail). This is ideal for publishing photographs or screenshots.','',1,'Title',1,'Body',0,0,0,1,'image');
INSERT INTO `node_type` VALUES ('page','Page','node','A <em>page</em> is suitable for information that rarely changes, such as an \"About us\" section of a website or institutional information. By default, a <em>page</em> entry does not allow visitor comments.','Specify a title and a main body for your page.<br/>\r\nYou can attach files too.',1,'Title',1,'Body',10,1,1,0,'page');
INSERT INTO `node_type` VALUES ('partner','Partner','node','A <em>partner</em> content type is suitable for creating and displaying partners of your project. <em>Partners</em> will be featured with their logo on the homepage, and you can give some more information and a link to their website.','<p>Describe your partner, including a description of its activity and its logo.<br />\r\nYou may also put a link to your partner\'s institutional website.</p>',1,'Name',1,'Description',0,1,1,0,'');
INSERT INTO `node_type` VALUES ('setting','Setting','node','Local settings of the website template.','',1,'Title',0,'',0,1,1,0,'');
INSERT INTO `node_type` VALUES ('story','Give20 Report','node','An <em>activity report</em> will present the final report of the Give20 fundraising activity containing pictures, total amount fundraised and other information.','',1,'Title',1,'Body',0,1,1,0,'');
